module.exports = /*#__PURE__*/JSON.parse('{"1":{"Apple Apple scab":{"Disease and Cause":"Apple scab is caused by the ascomycete fungus Venturia inaequalis.","Affected Plants":"This disease primarily affects Malus trees, including flowering crabapple and cultivated apple.","Symptoms and Impact":"Symptoms include dark, irregular lesions on foliage, blossoms, and fruits. The disease leads to fruit deformation and premature leaf and fruit drop.","Treatment":"Effective strategies include sanitation practices, resistance breeding, and the use of targeted fungicide or biocontrol treatments."}},"2":{"Apple Black rot":{"Disease and Cause":"Black rot is caused by the fungus Diplodia seriata (syn Botryosphaeria obtusa).","Affected Plants":"The fungus infects both dead and living tissues, including trunks, branches, leaves, and fruits.","Symptoms and Impact":"The fungi survive winter in branch cankers and mummified fruit (shriveled and dried fruit) attached to the tree.","Treatment":"Mancozeb and Ziram are highly effective against black rot.\\r\\nApplication"}},"3":{"Apple Cedar apple rust":{"Disease and Cause":"Rust diseases require plants from two different families (Cupressaceae and Rosaceae) to complete their life cycle.","Affected Plants":"Red cedar, juniper\\r\\nRosaceae","Treatment":"Use fungicides with the active ingredient Myclobutanil.\\r\\nApplication Timing"}},"4":{"Apple healthy":{}},"5":{"Bacterial leaf blight in rice leaf":{"Disease and Cause":"Rice bacterial blight, also known as bacterial blight of rice, is a deadly bacterial disease affecting cultivated rice (Oryza sativa and O. glaberrima).","Affected Plants":"Cultivated rice species Oryza sativa and O. glaberrima.","Symptoms and Impact":"This disease can cause severe epidemics, leading to crop losses as high as 75%. Millions of hectares of rice are infected annually.","Treatment":"Use balanced amounts of plant nutrients, especially nitrogen.\\r\\nField Management"}},"6":{"Leaf smut in rice leaf":{"Disease and Cause":"Leaf smut is caused by the fungus Entyloma oryzae.","Affected Plants":"Rice plants.","Symptoms and Impact":"The disease produces slightly raised, angular, black spots (sori) on both sides of the leaves.","Treatment":"Remove debris at the end of each growing season to prevent the spread of leaf smut.\\r\\nNutrient Management"}},"7":{"Brown spot in rice leaf":{"Disease and Cause":"Brown spot disease in rice is caused by the fungus Cochliobolus miyabeanus (formerly known as Helminthosporium oryzae).","Affected Plants":"Rice plants.","Symptoms and Impact":"The disease manifests as brown spots on rice leaves, which can lead to reduced plant health and crop yields.","Treatment":"Treat seeds with tricyclazole.\\r\\nFungicide Application"}},"8":{"Blight in corn Leaf":{"Disease and Cause":"Northern corn leaf blight (NCLB) is caused by the fungus Setosphaeria turcica (also known as Exserohilum turcicum).","Affected Plants":"Corn plants, especially in the U.S. Corn Belt.","Symptoms and Impact":"Symptoms usually appear first on the lower leaves and can lead to significant crop loss.","Treatment":"Apply fungicides around the time of silking when the infection usually begins. This step is more crucial for severe infections.\\r\\nHome Gardeners"}},"9":{"Gray Leaf Spot in corn Leaf":{"Disease and Cause":"Gray leaf spot is caused by the fungus Cercospora zeae-maydis.","Affected Plants":"Corn plants, particularly in the U.S. Corn Belt.","Symptoms and Impact":"This disease is typically the most serious foliar disease of corn in the U.S. Corn Belt, requiring extended periods of high humidity and warm conditions. It has been increasingly important in Indiana since the mid-1990s.","Resistant Varieties":"Plant corn varieties with resistance to the fungus, either race-specific resistance or partial rust resistance. Note that no sweet corn is completely resistant.\\r\\nFungicide Application"}},"10":{"Common Rust in corn Leaf":{"Disease and Cause":"Common rust is caused by the fungus Puccinia sorghi.","Affected Plants":"Corn plants.","Symptoms and Impact":"Rust-colored to dark brown, elongated pustules on both leaf surfaces. Pustules contain cinnamon brown rust spores (urediniospores) and darken with age. Leaves and sheaths can be infected.\\r\\nImpact","Lifecycle":"The fungus overwinters on plants in southern states, and airborne spores are wind-blown to northern states during the growing season.\\r\\nManagement"}},"11":{"Corn (maize) healthy":{}},"12":{"Grape Black rot":{"Disease and Cause":"Caused by the fungus Guignardia bidwellii.","Affected Plants":"Grape vines.","Symptoms and Impact":"Black-bordered brown patches on leaves, affecting all green parts.\\r\\nImpact","Treatment":"Apply Mancozeb and Ziram before infection to prevent spore germination.\\r\\nManagement"}},"13":{"Grape Esca Black Measles":{"Disease and Cause":"Grapevine measles, also known as esca, black measles, or Spanish measles, is a complex disease caused by various wood-infecting fungi.","Affected Plants":"Grapevines.","Symptoms and Impact":"Superficial spots on the fruit. Foliar symptoms include interveinal striping, which starts as dark red in red cultivars and yellow in white cultivars, eventually drying and becoming necrotic.\\r\\nPrevention and Treatment","Treatment":"Understanding and managing wood-infecting fungi are crucial. Proper vineyard sanitation and pruning practices can help reduce the incidence of the disease. Use fungicides and resistant grapevine varieties where applicable."}},"14":{"Grape Leaf blight Isariopsis Leaf Spot":{"Disease and Cause":"Leaf blight, also known as Isariopsis leaf spot, is caused by the fungus Pseudocercospora vitis.","Affected Plants":"Grapevines (Vitus sp.)","Symptoms and Impact":"Scattered, somewhat angular, purple-brown spots on the upper leaf surface, and corresponding, less conspicuous brown spots on the lower leaf surface.\\r\\nPrevention and Treatment","Treatment":"Apply lime sulfur, sulfur, or copper formulations during dormancy to kill fungal spores that overwinter on the vine.\\r\\nSeason Preparation"}},"15":{"Grape healthy":{}},"16":{"Pepper bell Bacterial spot":{"Disease and Cause":"Bacterial spot is a devastating disease of pepper and tomato plants.","Affected Plants":"Peppers and tomatoes.","Symptoms and Impact":"Brown, scab-like lesions on fruits and leaves.\\r\\nImpact","Treatment":"Soak seeds in hot water (125°F/51°C) for 30 minutes to reduce bacterial populations on the surface and inside the seeds. This method is effective but must be done accurately to avoid affecting seed germination. Bleach treatment is a lower-risk alternative.\\r\\nEnvironmental Management"}},"17":{"Pepper bell healthy":{}},"18":{"Potato Early blight":{"Disease and Cause":"Early blight of potato is caused by the fungal pathogen Alternaria solani.","Affected Plants":"Potatoes, affecting leaves, stems, and tubers.","Symptoms and Impact":"Dark blotches on leaves, starting at the tips and edges, spreading to cause foliage to shrivel and collapse. Blotches also appear on stems, which turn black and rot.\\r\\nImpact","Resistant Varieties":"Plant potato varieties resistant to early blight; late-maturing varieties are more resistant than early-maturing ones.\\r\\nIrrigation Management"}},"19":{"Potato Late blight":{"Disease and Cause":"Late blight, also known as potato blight, is caused by the water mold Phytophthora infestans.","Affected Plants":"Potatoes and tomatoes.","Symptoms and Impact":"Plants rot within two weeks of infection.\\r\\nImpact","Cultural Practices":"Eliminate cull piles and volunteer potatoes, use proper harvesting and storage practices.\\r\\nFungicide Application"}},"20":{"Potato healthy":{}},"21":{"potato hollow heart":{"Disease and Cause":"Hollow heart is a common internal defect in potatoes caused by alternating periods of slow and fast growth.","Affected Plants":"Potatoes.","Symptoms and Impact":"Internal voids or cavities within the tubers.\\r\\nImpact","Treatment":"Plant potatoes when soil temperature reaches 60°F (16°C) to prevent sudden growth spurts.\\r\\nSoil Warming"}},"22":{"Tomato Bacterial spot":{"Disease and Cause":"Bacterial spot of tomato is caused by four bacterial pathogens","Affected Plants":"Tomato plants.","Symptoms and Impact":"Can be introduced via contaminated seed and transplants, which may not always show symptoms initially.\\r\\nImpact","Treatment":"Remove old vegetable debris and avoid planting new crops where host plants were previously grown.\\r\\nMechanical Control"}},"23":{"Tomato Early blight":{"Disease and Cause":"Caused by the fungus Alternaria solani.","Affected Plants":"Tomatoes.","Symptoms and Impact":"Round leaf spots with dark concentric rings, about 0.5 inch in diameter, appearing first on older leaves. Affects stems and fruit; can kill young seedlings.\\r\\nImpact","Growing Conditions":"Ensure proper fertilization, irrigation, and pest management.\\r\\nVarieties"}},"24":{"Tomato Late blight":{"Disease and Cause":"Late blight is caused by the water mold Phytophthora infestans.","Affected Plants":"Tomatoes and potatoes.","Symptoms and Impact":"Infects leaves, stems, tomato fruit, and potato tubers.\\r\\nImpact","Treatment":"Avoid planting tomatoes in areas previously used for potatoes or near potato crops.\\r\\nPlanting Strategy"}},"25":{"Tomato Leaf Mold":{"Disease and Cause":"Tomato leaf mold is a fungal disease that develops under conditions of extended leaf wetness and high relative humidity (greater than 85%).","Affected Plants":"Primarily affects tomatoes, especially in hoophouses and greenhouses.","Symptoms and Impact":"Mold forms on the underside of leaves, potentially affecting the entire plant.\\r\\nImpact","Environmental Control":"Manage humidity levels and ensure good air circulation to reduce leaf wetness.\\r\\nBaking Soda Solution"}},"26":{"Tomato Septoria leaf spot":{"Disease and Cause":"Caused by the fungus Septoria lycopersici.","Affected Plants":"Tomatoes.","Symptoms and Impact":"Appears on lower leaves after the first fruit sets. Characterized by spots on leaves, leading to severe foliage damage.\\r\\nImpact","Remove Infected Leaves":"Remove infected leaves immediately. Wash hands and pruners thoroughly before handling uninfected plants.\\r\\nOrganic Fungicides"}},"27":{"Tomato Spider mites Two spotted spider mite":{"Disease and Cause":"Infestation by the two-spotted spider mite, a common pest.","Affected Plants":"Tomatoes, eggplant, potatoes, vine crops (melons, cucumbers), and other vegetables and fruits.","Symptoms and Impact":"Yellowing leaves, webbing, and reduced plant vigor.\\r\\nImpact","Treatment":"Use a miticide specific to spider mites.\\r\\nEarly Treatment"}},"28":{"Tomato Target Spot":{"Disease and Cause":"Target spot, also known as early blight, is caused by a fungal pathogen.","Affected Plants":"Tomatoes, papaya, peppers, snap beans, potatoes, cantaloupe, squash, passion flower, and certain ornamentals.","Symptoms and Impact":"Black, leathery spots on tomatoes. When cut, the fruit inside appears mealy.\\r\\nImpact","Calcium Deficiency":"Plants are not getting enough calcium, either due to low calcium in the soil or low pH preventing calcium absorption.\\r\\nPrevention and Treatment","Treatment":"Ensure adequate calcium levels in the soil.\\r\\npH Adjustment"}},"29":{"Tomato Tomato mosaic virus":{"Disease and Cause":"Tomato mosaic virus (ToMV) is a plant pathogenic virus.","Symptoms and Impact":"Mosaic pattern on leaves, stunted growth, and reduced fruit quality.\\r\\nImpact","Prevention":"Key as there is no cure once plants are infected.\\r\\nInfected Plant Removal"}},"30":{"Tomato healthy":{}},"31":{"tomato canker":{"Disease and Cause":"Plant canker is an area of dead tissue on a plant, caused by various organisms including fungi, bacteria, mycoplasmas, and viruses.","Symptoms and Impact":"Small area of dead tissue that grows slowly over years.\\r\\nImpact","Pathogen-Free Seed":"Plant certified pathogen-free seed from reputable suppliers.\\r\\nSeed Treatment"}},"32":{"algal leaf in tea":{"Disease and Cause":"Algal leaf spot, also known as red rust, is caused by the algal plant pathogen Cephaleuros virescens and Cephaleuros parasiticus.","Symptoms and Impact":"Leaf and fruit spots, affecting the plant\'s growth and vigor.\\r\\nImpact","Treatment":"Maintain tree vigor with proper fertilization and irrigation.\\r\\nPruning"}},"33":{"anthracnose in tea":{"Disease and Cause":"Anthracnose is caused by the fungus Colletotrichum spp., specifically Colletotrichum lagenarium.","Symptoms and Impact":"Water-soaked lesions on leaves, small yellowish watery spots that become brownish, oblong lesions on stems, and round black sunken cankers on fruits.\\r\\nGeneral Symptoms","Monitoring and Early Detection":"Regularly inspect plants for early signs of the disease.\\r\\nCultural Practices"}},"34":{"bird eye spot in tea":{"Disease and Cause":"Bird\'s eye spot disease is caused by the fungus Cercospora theae Petch.","Affected Plants":"Tea plants.","Symptoms and Impact":"Characteristic spots on tea leaves.\\r\\nImpact","Resistant Clones":"Use clones that show tolerance to the disease, such as UPASI-3, 17, 19, 25-27, and Sri Lankan clones TRI-2024 and TRI-2025.\\r\\nCultural Practices","Isolates":"Three isolates (KC10, MC24, VC38) were identified, showing minor variations in growth and life cycle.\\r\\nPathogenicity"}},"35":{"brown blight in tea":{"Disease and Cause":"Brown blight disease, also known as Poria root disease, is a foliar disease of tea (Camellia sinensis).","Affected Plants":"Tea plants.","Symptoms and Impact":"Yellowing of leaves, followed by wilting and sudden death of the bush, with weathered leaves remaining attached to the stem for several days.\\r\\nImpact","Monitoring":"Regularly inspect plants for early symptoms.\\r\\nCultural Practices"}},"36":{"healthy tea leaf":{}},"37":{"red leaf spot in tea":{"Symptoms and Impact":"Red or reddish-brown spots or irregular patches on leaves.\\r\\nTea Red Scab Disease","Treatment":"•Regular Monitoring"}},"38":{"Strawberry Leaf scorch":{"Disease and Cause":"Leaf scorch is caused by the fungus Diplocarpon earliana.","Affected Plants":"Strawberries.","Symptoms and Impact":"Numerous small, irregular, purplish spots or blotches on the upper surface of leaves. The centers of these blotches become brownish. Advanced lesions produce dark brown to black apothecia.\\r\\nImpact","Remove Infected Leaves and Debris":"Regularly remove and destroy infected leaves and plant debris to reduce the spread of the fungus.\\r\\nIncrease Air Circulation"}},"39":{"Strawberry healthy":{}},"40":{"Cherry (including sour) Powdery mildew":{"Disease and Cause":"Powdery mildew is caused by the obligate biotrophic fungus Podosphaera clandestina.","Affected Plants":"Sweet and sour cherry (Prunus avium), particularly mid- and late-season cultivars.","Symptoms and Impact":"White fungal growth on the surface of cherries, making them unmarketable.\\r\\nImpact","Treatment":"Use a mixture of 2-3 tablespoons of apple cider vinegar (5% acetic acid) in a gallon of water to control powdery mildew.\\r\\nEarly Detection"}},"41":{"Cherry (including_sour) healthy":{}}}');

